    opname = {83: 'RETURN_VALUE', 84: 'RAISE_VARARGS'}
    if opcode == 90 or opcode == opmap['RAISE_VARARGS']:
        return -args[0]
    elif opcode == 83:
        return -2
    elif opcode == 84:
        return -2
    else:
        print(opcode, *args)
        assert 0, opname.get(opcode, f'Unknown opcode: {opcode}')

